def rateCal(up: Long, down: Long): Double = {
    math.round((up / down.toDouble) * 10000) / 10000.0
}

%spark
def calMap(temps: List[String]): scala.collection.immutable.Map[String, Int] = {
    val rst = scala.collection.mutable.Map[String, Int]()
    for (i <- temps) {
        rst(i) = rst.getOrElse(i, 0) + 1
    }
    rst.toMap
}

